import './App.css';
import React, { useState } from 'react';
import { HashRouter, Route, Routes } from 'react-router-dom';

import Header from './components/Header';
import Process from './components/Process';

type Doc = {
  id: string;
  name: string;
  rev: string;
};

const App: React.FC = () => {
  const [name, setName] = useState<string>('');
  const [docu, setDocu] = useState<Doc[]>([]);
  const [id, setId] = useState<string>();
  const [rev, setRev] = useState<string>();
  const [dTitle, setDTitle] = useState<string>(' 新しいドキュメントを作成');
  const [list, setList] = useState<Doc[]>([]);

  const nullTitle = () => {
    setDTitle('');
    console.log(dTitle);
  };
  const defaultTitle = () => {
    setDTitle(' 新しいドキュメントを作成');
    // console.log(dTitle);
  };
  const handleDocTitle = () => {
    setList([...docu]);
  };

  // ドキュメントの名前を入力して登録する
  const docuTitle = (e: any) => {
    setDTitle(e.target.value);
    // console.log(dTitle);
  };

  return (
    <HashRouter>
      <Header />
      <div className='App'>
        <div className='Top'>
          <div className='TopContainer'>
            <div className='TopContainer__Left'>
              <div className='TopHead'>
                <div className='TopButton'>
                  <form onSubmit={defaultTitle}>
                    <input
                      className='TopButton__name'
                      type='text'
                      id='name'
                      onChange={docuTitle}
                      value={dTitle}
                      onClick={nullTitle}
                    ></input>
                    <button className='TopButton__button' type='submit' onClick={handleDocTitle}>
                      作成する
                    </button>
                  </form>
                </div>
                <div className='TopHead__title'>＜ドキュメント一覧＞</div>
              </div>
              <ul className='TopList'>
                {/* {docu.map((docu, i) => (
                  <li key={i} className="TopList__item">
                    <Link
                      to={"/part/" + docu.name}
                      className="TopList__itemName"
                    >
                      <p>{docu.name}</p>
                    </Link>
                    </li>
                ))} */}
              </ul>
            </div>
            <div className='TopContainer__Right'>
              <Routes>
                <Route path='/top' element={<Process />} />
                {/* <Route path="/" element={<Index />} />
                <Route path="/test" element={<Test />} /> */}
              </Routes>
            </div>
          </div>
        </div>
      </div>
      {/* <Footer /> */}
    </HashRouter>
  );
};

export default App;
